import React from 'react'
import {
    Link,
    useRouteMatch
} from "react-router-dom";
import './styleNav.css';

function Nav() {
    let { url } = useRouteMatch();
    return (
        <div>
            <div class="collapse" id="navbarToggleExternalContent">
                <div class="bg-dark p-4">
                    <nav className='navbar'>
                        <Link to={`${url}application/info`} className='links'>Info</Link>
                        <Link to={`${url}application/toodos`} className='links'>Toodos</Link>
                        <Link to={`${url}application/posts`} className='links'>Posts</Link>
                        <Link to={`${url}application/albums`} className='links'>Albums</Link>
                    </nav>
                </div>
            </div>
            <nav class="navbar navbar-dark bg-dark">
                <div class="container-fluid">
                    <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarToggleExternalContent" aria-controls="navbarToggleExternalContent" aria-expanded="false" aria-label="Toggle navigation">
                        <span class="navbar-toggler-icon"></span>
                    </button>
                </div>
            </nav>
        </div>
        // <nav className='navbar'>
        //     <Link to={`${url}application/info`} className='links'>Info</Link>
        //     <Link to={`${url}application/toodos`} className='links'>Toodos</Link>
        //     <Link to={`${url}application/posts`} className='links'>Posts</Link>
        //     <Link to={`${url}application/albums`} className='links'>Albums</Link>
        // </nav>
    )
}
export default Nav;
